import axios from 'axios';

const API_URL = 'http://localhost:8080/api';

export const registerUser = async (user) => {
    return axios.post(`${API_URL}/users`, user);
};

export const fetchCarsByUser = async (userId) => {
    return axios.get(`${API_URL}/cars`, { params: { userId } });
};

export const searchCars = async (keyword) => {
    return axios.get(`${API_URL}/cars/search`, { params: { keyword } });
};

export const addCar = async (car) => {
    return axios.post(`${API_URL}/cars`, car);
};

export const updateCar = async (id, updatedCar) => {
    return axios.put(`${API_URL}/cars/${id}`, updatedCar);
};

export const deleteCar = async (id) => {
    return axios.delete(`${API_URL}/cars/${id}`);
};
